import React from "react";
import Navbar from "./Navbar";
const Home = () => {
  return (
    <div className="flex items-center justify-center h-screen bg-gray-100  p-4">
      <Navbar />
      <h1 className="text-4xl font-bold">Welcome to Home Page</h1>
    </div>
  );
};

export default Home;
